import React from 'react'
import { makeStyles } from '@material-ui/core/styles';



const useStyles=makeStyles(theme=>({



}))

const Gallery = () => {
    const classes=useStyles()
    return (
        <>
       <div className={classes.imgGallery}>

       <img src={ process.env.PUBLIC_URL + '/images/r1.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r2.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r3.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r4.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r5.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r6.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r7.jpg'}  alt="" />
       <img src={ process.env.PUBLIC_URL + '/images/r8.jpg'}  alt="" />



           </div>        




        </>
    )
}

export default Gallery
